library(shiny)
library(shinyjs)
library(bslib)

ui <- page_sidebar(
  titlePanel("Game of Thrones Analyzer"),
  useShinyjs(),

  # Links to external CSS and JS code
  tags$head(
    tags$link(rel = "stylesheet", type = "text/css", href = "styles.css"),
    tags$script(src = "script.js")  # Link to the external JS file
  ),

  layout_column_wrap(
    width = 1/2,
    heights_equal = "row",

    card(
      div(id = "map-container",
        tags$img(id = "map-img", src = "westeros.jpg"),
        tags$svg(id = "map-canvas"),
      )
    ),

    card(
      card_header("Dummy Card"),
      numericInput("x_coord", "X Coordinate", value = 0, min = 0, max = 1),
      numericInput("y_coord", "Y Coordinate", value = 0, min = 0, max = 1),
      numericInput("diameter", "Circle Diameter", value = 0.1, min = 0, max = 1),
      actionButton("draw_circle", "Draw Circle"),

      card_footer("Graphic coming soon...")
    )
  ),

  card(id = "bottom-card",
    div(class = "full-horizontal-choices",
        checkboxGroupInput(
          inputId = "season",
          label = "Select seasons and episodes of interest:",
          choices = c("Season 1", "Season 2", "Season 3", "Season 4", 
                      "Season 5", "Season 6", "Season 7", "Season 8"),
          inline = TRUE,
        ),
        # Placeholder for dynamically generated episode choices
        uiOutput("episode_ui"),
    ),
  )
)

server <- function(input, output, session) {

  # Draw circle when button is pressed
  observeEvent(input$draw_circle, {
    runjs(sprintf("drawCircle(%f, %f, %f, '#5e35b1');", 
                  input$x_coord, input$y_coord, input$diameter))
  })

  # Dynamically show episode checkboxGroupInput based on selected season
  observeEvent(input$season, {
    # If exactly one season is selected, show episode choices
    if (!is.null(input$season) && length(input$season) == 1) {
      output$episode_ui <- renderUI({
        div(class = "full-horizontal-choices",
            checkboxGroupInput(
              inputId = "episode",
              label = NULL,
              choices = paste0("Episode ", 1:10),  # Episodes 1-10
              inline = TRUE
            )
        )
      })
    } else {
      # If no season or multiple seasons are selected, hide the episode choices
      output$episode_ui <- renderUI({
        NULL
      })
    }
  })

}

shinyApp(ui = ui, server = server)

$(document).on('shiny:inputchanged', function(event) {
  if (event.name === 'season') {
    $('input[name="season"]').each(function() {
      var checkboxValue = $(this).val();
      if ($(this).is(':checked')) {
        $('label:contains(' + checkboxValue + ')').addClass('selected');
      } else {
        $('label:contains(' + checkboxValue + ')').removeClass('selected');
      }
    });
  }

  if (event.name === 'episode') {
    $('input[name="episode"]').each(function() {
      var checkboxValue = $(this).val();
      if ($(this).is(':checked')) {
        $('label:contains(' + checkboxValue + ')').addClass('selected');
      } else {
        $('label:contains(' + checkboxValue + ')').removeClass('selected');
      }
    });
  }
});

// Function to update SVG canvas size based on image dimensions
function updateSVGSize() {
  var img = document.getElementById('map-img');
  var svg = document.getElementById('map-canvas');
  if (img.complete) {
    svg.setAttribute('viewBox', `0 0 ${img.naturalWidth} ${img.naturalHeight}`);
  }
} 
// Call updateSVGSize when window resizes
window.addEventListener('resize', updateSVGSize);
// Ensure SVG is synced with the image dimensions on image load
document.getElementById('map-img').addEventListener('load', updateSVGSize);

// Draw circle based on the resized image dimensions
function drawCircle(x, y, diameter, color) {
  var svg = document.getElementById('map-canvas');
  var viewBox = svg.viewBox.baseVal;
  var newCircle = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
  newCircle.setAttribute('cx', x * viewBox.width);
  newCircle.setAttribute('cy', y * viewBox.height);
  newCircle.setAttribute('r', 1/2 * diameter * Math.min(viewBox.width, viewBox.height));
  newCircle.setAttribute('fill', color);
  svg.appendChild(newCircle);
}

/* Make it possible for the application to draw on top of the image 
 * The image and the canvas are children of the container.
 */
#map-container {
  position: relative;
  display: inline-block;
  width: 100%;
}
#map-img {
  width: 100%; /* Image is as wide as the container */
  height: auto; /* Preserve aspect ratio */
}
#map-canvas {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%; /* SVG is as wide as the container */
  height: 100%;
  pointer-events: none; /* Prevent interference with clicks */
  z-index: 10; /* Ensure canvas is on top of image */
}

#bottom-card {
  height: 320px;
}
#season {
  margin-bottom: 0.5rem;
}
#episode {
  margin-bottom: 0.5rem;
}
/* The checkboxes span the whole width and are aligned horizontally */
.full-horizontal-choices .shiny-options-group {
  width: 100%;
  display: flex;
  flex-wrap: nowrap;
  gap: 0; /* Ensure no gap between buttons */
}

/* Default checkboxes are hidden */
.full-horizontal-choices .shiny-options-group input[type='checkbox'] {
  display: none;
}

.full-horizontal-choices .shiny-options-group label {
    display: flex !important;
    align-items: center;
    justify-content: center;
    min-width: min-content;  /* Don't shrink below the width of the text */
    border: 1px solid #2b2b2b;
    background-color: #a9dfbf;
    padding: 0 !important; /* Remove the padding in front of the text for proper centering */
    font-family: sans-serif; /* Todo: https://fontmeme.com/fonts/game-of-thrones-font/ */
    width: 100%;
    height: 30px;
    white-space: nowrap;
    cursor: pointer;
    margin: 0;
    border-left: none;
    border-right: none;
}

/* First option has left border */
.full-horizontal-choices .shiny-options-group label:first-child {
    border-left: 1px solid #2b2b2b;
}
/* Last option has right border */
.full-horizontal-choices .shiny-options-group label:last-child {
    border-right: 1px solid #2b2b2b;
}

/* Color of button changes when selected */
.full-horizontal-choices .shiny-options-group label.selected {
  background-color: #27ae60;
}
/* Color of button changes on hover */
.full-horizontal-choices .shiny-options-group label:hover {
  background-color: #52be80 ;
}
